import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})
export class HomeComponent {

  constructor(private router: Router) {}
  goTomedicament() {
    this.router.navigate(['/', 'medicament']);
  }
    goTomedical_medical_supply(){
      this.router.navigate(['/', 'medical_supplies']);
    }
}
<div> 
  <img id="himg" src="../assets/sign_in_image.png" alt="rrrr">
 <a href="add-medicament"><button class="but"> Post an announcement </button></a> 
  <button class="but1"> Post a request </button>
  <button class="but2"> View request </button>


</div>




<div class="immg">
  <br>
<div class="img1">  <a (click)="goTomedicament()" href="medicament"> <img src="assets/medicament.jpg" alt="can't read it" height="350px" width="350px"></a>
  <button class="butin"> <a (click)="goTomedicament()"> Medicaments</a></button>
</div>
<div class="img1">  <a (click)="goTomedical_medical_supply()" href="medical_supplies"><img src="assets/medical_supply.png" alt="can't read it" height="350px" width="350px"></a>
  <button class="but1in"> <a (click)="goTomedical_medical_supply()" > Medical supplies</a></button>
</div>
